Quarantine gets a bad rap! Check out the official music video for #BadDream. Coming soon to iTunes, Spotify, Google Play and more. Proceeds from downloads to benefit #NoKidHungry and #FeedingAmerica!

In these trying times, I pray that we all are able to stay safe, healthy, patient, and hopeful. I want to thank healthcare workers,first responders, people on the frontlines, teachers and all essential workers. You are saving lives, showing us the best of what humanity has to offer, and helping us through to a better future. God bless.

To take action or make a donation, please visit:
